import React from 'react';
import { PieChart, PieArcSeries } from 'reaviz';

const CompatabilityCharts = ({ mbtiData }) => (
  <div className="chart-container" id="comp">
    {mbtiData && (
      <>
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={[
              { key: 'I', data: mbtiData.EI },
              { key: 'E', data: 100 - mbtiData.EI }
            ]}
            series={<PieArcSeries colorScheme={['#E5E8B6', '#F6DC8D']} />}
          />
        </div>
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={[
              { key: 'S', data: mbtiData.SN },
              { key: 'N', data: 100 - mbtiData.SN }
            ]}
            series={<PieArcSeries colorScheme={['#BEB8EB', '#022B3A']} />}
          />
        </div>
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={[
              { key: 'T', data: mbtiData.TF },
              { key: 'F', data: 100 - mbtiData.TF }
            ]}
            series={<PieArcSeries colorScheme={['#E3EEE2', '#ACD1E9']} />}
          />
        </div>
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={[
              { key: 'J', data: mbtiData.JP },
              { key: 'P', data: 100 - mbtiData.JP }
            ]}
            series={<PieArcSeries colorScheme={['#F49A9A91', '#E0E0E2']} />}
          />
        </div>
      </>
    )}
  </div>
);

const Compatability = ({ userMbti, memberMbti, userName, memberName }) => {
  console.log('User MBTI:', userMbti);
  console.log('Member MBTI:', memberMbti);

  const userCharts = [
      { key: 'E', data: userMbti?.EI || 0, opposite: 'I' },
      { key: 'S', data: userMbti?.SN || 0, opposite: 'N' },
      { key: 'T', data: userMbti?.TF || 0, opposite: 'F' },
      { key: 'J', data: userMbti?.JP || 0, opposite: 'P' }
  ];

  const memberCharts = [
      { key: 'E', data: memberMbti?.EI || 0, opposite: 'I' },
      { key: 'S', data: memberMbti?.SN || 0, opposite: 'N' },
      { key: 'T', data: memberMbti?.TF || 0, opposite: 'F' },
      { key: 'J', data: memberMbti?.JP || 0, opposite: 'P' }
  ];

  const renderCharts = (charts) => (
      charts.map((chart, index) => (
          <div className="chart-wrap" key={index}>
              <PieChart
                  width={250}
                  height={250}
                  data={[
                      { key: chart.key, data: chart.data },
                      { key: chart.opposite, data: 100 - chart.data }
                  ]}
                  series={<PieArcSeries colorScheme={['#E5E8B6', '#F6DC8D']} />}
              />
          </div>
      ))
  );

  return (
      <div className="compatibility-charts">
          <div>
              <h2>{userName} MBTI</h2>
              <div className="chart-container">
                  {renderCharts(userCharts)}
              </div>
          </div>
          <div>
              <h2>{memberName} MBTI</h2>
              <div className="chart-container">
                  {renderCharts(memberCharts)}
              </div>
          </div>
      </div>
  );
}

export { Compatability };
